import { Component, OnInit } from '@angular/core';
import { fabric } from 'fabric';

@Component({
  selector: 'app-canvas-editor',
  templateUrl: './canvas-editor.component.html',
  styleUrls: ['./canvas-editor.component.scss']
})
export class CanvasEditorComponent implements OnInit {
  canvas: any;
  initSVG: any;

  constructor() { }

  ngOnInit(): void {
    this.canvas = new fabric.Canvas('canvas');
    // const robotoFont = new Fon

    fabric.Image.fromURL("data:image/jpeg;base64,",
      (img) => {
        img.set('left', 500);
        this.canvas.add(img);
        img.sendToBack();
    });

    const priceText = new fabric.IText('2', {
      fontFamily: 'Roboto',
      fontWeight: 'bold',
      fontSize: 200,
      top: 20,
      left: 10,
      fill: 'red'
    });

    const priceText2 = new fabric.IText('99', {
      fontFamily: 'Roboto',
      fontWeight: 'bold',
      fontSize: 110,
      top: 30,
      left: 130,
      fill: 'red'
    });

    const priceText3 = new fabric.IText('2', {
      fontFamily: 'Roboto',
      fontWeight: 'bold',
      fontSize: 50,
      top: 140,
      left: 140,
      fill: '#c3bfbf'
    });

    const priceText4 = new fabric.IText('99', {
      fontFamily: 'Roboto',
      fontWeight: 'bold',
      fontSize: 20,
      top: 145,
      left: 170,
      fill: '#c3bfbf'
    });

    const text1 = new fabric.IText('Żywiec Saison', {
      fontFamily: 'Roboto',
      fontWeight: 'bold',
      fontSize: 70,
      top: 450,
      left: 10
    });

    const text2 = new fabric.IText('piwo butelkowe 0,5l', {
      fontFamily: 'Arial',
      fontWeight: 'normal',
      fill: '#c3bfbf',
      fontSize: 35,
      top: 520,
      left: 10
    });

    this.canvas.add(priceText, priceText2, priceText3, priceText4, text1, text2);
    text1.bringToFront();

    this.initSVG = this.canvas.toSVG();
    console.log(this.initSVG);
  }

  // tslint:disable-next-line:typedef
  exportSVG() {
    const svg = this.canvas.toSVG();
    console.log(svg);
    console.log('takie samo jak init?: ', svg === this.initSVG);
  }

}
